Actionscript.script:
攻击时移动 = _root.敌人二级函数.攻击时移动;
攻击时四向移动 = _root.敌人二级函数.攻击时四向移动;

抓取 = false;
抓取目标 = "";
抓取方向 = "";
Z轴抓取范围 = 60;

function 抓取持续判定() {
	//!_root.gameworld[抓取目标].刚体
	//现在可以抓取霸体敌人
	return (抓取 && !_root.gameworld[抓取目标].倒地 && _root.gameworld[抓取目标].hp > 0);
}
function 持续抓取(){
	if (!抓取持续判定() or _parent.方向 != 抓取方向) {
		抓取 = false;
		gotoAndPlay("抓取结束");
		return;
	}
	var target = _root.gameworld[抓取目标];
	var myPoint = {x:this.抓取点._x, y:this.抓取点._y};
	this.localToGlobal(myPoint);
	_root.gameworld.globalToLocal(myPoint);
	var shootX = myPoint.x;

	var vx = shootX - target._x;
	var vz = _parent.Z轴坐标 - target.Z轴坐标 - 1;
	var dx = "右";
	var dz = "下";
	if(vx < 0){
		dx = "左";
		vx = -vx;
	}
	if(vz < 0){
		dz = "上";
		vz = -vz;
	}
	target.强制移动(dx,vx);
	target.强制移动(dz,vz);

	if(target.浮空){
		target._y = target.Z轴坐标 - 10;
	}else{
		target._y = target.Z轴坐标;
	}
}

function 射击()
{
	var 子弹属性 = _root.子弹属性初始化(this.攻击点);
	子弹属性.声音 = "fr506.wav";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 4;
	子弹属性.发射效果 = "";
	子弹属性.子弹种类 = "加强普通子弹";
	子弹属性.子弹威力 = 2 * _parent.空手攻击力;
	子弹属性.子弹速度 = 36;
	子弹属性.击中地图效果 = "火花";
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 24;
	子弹属性.击中后子弹的效果 = "";
	子弹属性.子弹敌我属性 = !_parent.是否为敌人;
	_root.子弹区域shoot传递(子弹属性);
}

