if (Math.abs(_parent.Z轴坐标 - _root.gameworld[_parent.攻击目标].Z轴坐标) < Z轴抓取范围 && _root.gameworld[_parent.攻击目标].area.hitTest(this.抓取碰撞箱))
{
	//!_root.gameworld[_parent.攻击目标].刚体
	if (!_root.gameworld[_parent.攻击目标].倒地 && _root.gameworld[_parent.攻击目标].hp > 0)
	{
		抓取 = true;
		抓取目标 = _parent.攻击目标;
		抓取方向 = _parent.方向;
		break;
	}
}
if (抓取)
{
	gotoAndPlay("抓取成功");
}

